import { createUser, uploadPhoto } from './utils';

export default async function asyncUploadUser() {
  try {
    const [photo, user] = await Promise.all([uploadPhoto(), createUser()]);
    return {
      photo: photo.body,
      user,
    };
  } catch (error) {
    return {
      photo: null,
      user: null,
    };
  }
}
